import React from "react";
import ReactDOM from "react-dom";
import Home from "./Home";

class App extends React.Component {
  state = {
    text: "Welcome Message",
  };
  render() {
    return (
      <div>
        <Home />
      </div>
    );
  }
}

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
